'%{
\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cWhen you did make a friend, you did everything for her. If a friend quit her job and had nowhere to stay, you shared your bunk despite the risk of a ten-yuan fine, about $1.25, if you got caught. If she worked far away, you would get up early on a rare day off and ride hours on the bus, and at the other end your friend would take leave from work—this time, the fine one hundred yuan—to spend the day with you. You might stay at a factory you didn’t like, or quit one you did, because a friend asked you to. Friends wrote letters every week, although the girls who had been out longer considered that childish. They sent messages by mobile phone instead.\n\n8 mai 2016\n\u001c8\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cYour factory is not worth wasting my whole youth here,” she told her boss. She signed up for a computer class at a nearby commercial school. When there wasn’t an overtime shift, she skipped dinner and took a few hours of lessons in how to type on a keyboard or fill out forms by computer. Most of the factory girls believed they were so poorly educated that taking a class wouldn’t help, but Min was\n\n8 mai 2016\n\u001c12\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cdifferent. “Learning is better than not learning,” she reasoned. She phoned home and said she was thinking of quitting her job. Her parents, who farmed a small plot of land and had three younger children still in school, advised against it. “You always want to jump from this place to that place,” her father said. Girls should not be so flighty. Stay in one place and save some money, he told her.\n\n8 mai 2016\n\u001c12\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cMoney sent home by migrants is already the biggest source of wealth accumulation in rural China. Yet earning money isn’t the only\n\n8 mai 2016\n\u001c17\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001creason people migrate. In surveys, migrants rank “seeing the world,” “developing myself,” and “learning new skills” as important as increasing their incomes. In many cases, it is not crippling poverty that drives migrants out from home, but idleness. Plots of land are small and easily farmed by parents; nearby towns offer few job opportunities. There was nothing to do at home, so I went out.\n\n8 mai 2016\n\u001c17\n\u0011\n\u0011\n\n\n2 The City\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cHe admitted that the local government lacked the resources to check conditions in the factories. “If I inspected one factory a day,” he said, “it would take me fifty years to inspect all the factories. So we must rely on the companies to police themselves.” The deputy mayor then talked of a plan to “lift the quality of the Dongguan people,” but the effort excluded those who were not native-born. Like all city people, he had a reflexive contempt for waidiren, outsiders, the common term for migrants. “The quality of migrant workers is not high,” he said, “but this is the responsibility of the companies. They should be running\n\n8 mai 2016\n\u001c35\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cclasses for workers.” I asked the deputy mayor why there were no Dongguan people in the factories, even at the highest levels, and he contradicted what he had just said without missing a beat. “The people from outside,” he said, “have higher quality and lower wages.”\n\n8 mai 2016\n\u001c35\n\u0011\n\u0011\n\n\n3 To Die Poor Is a Sin\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cshe plotted her escape from this world through a relentless program of self-improvement: reading novels, practicing her handwriting, and learning to speak—both to erase her Hunan accent and to master Cantonese, the language of the factory bosses. Her greatest fear was of getting stuck where she was. Time was Chunming’s enemy, reminding her that another day had passed and she had not yet achieved her goals. But time was also her friend, because she was still young.\n\n9 mai 2016\n\u001c50\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cMother, I have knit my love for you into this sweater . . . Mother, remember when I was still at home, you always said other people’s daughters knew how to knit sweaters but that I lacked perseverance. But today, do you see that your daughter also knows how to knit? Remember, your daughter will never be dumber than other people!\n\n9 mai 2016\n\u001c52\n\u0011\n\u0011"},{"ty":"ae","et":"inline","id":"i.0","epm":{"ee_eo":{"eo_bo":{"ln_c":"#000000","ln_s":0,"ln_w":0.0},"eo_lco":{"lc_oi":"","lc_cs":"","lc_ct":0,"lc_sci":""},"i_wth":105.0,"eo_rd":null,"eo_mb":1.5,"eo_at":null,"eo_hb":false,"eo_lc":null,"eo_rtd":"","i_crop":{"crop_oxr":0.0,"crop_oyr":0.0,"crop_rot":0.0,"crop_hr":1.0,"crop_wr":1.0},"i_ht":150.9375,"i_rot":0.0,"i_clst":{"cv":{"op":"set","opValue":[]}},"eo_ml":1.5,"i_bri":0.0,"eo_mr":1.5,"i_src":null,"eo_ad":"Cover Image","i_cid":"1De3-Wgq783-7iD9TVxlf4cH2nsRmgw_hBKHUBw8","i_cont":0.0,"i_opa":1.0,"eo_mt":1.5,"eo_type":0}}},{"ty":"ae","et":"inline","id":"i.1","epm":{"ee_eo":{"eo_bo":{"ln_c":"#000000","ln_s":0,"ln_w":0.0},"eo_lco":{"lc_oi":"","lc_cs":"","lc_ct":0,"lc_sci":""},"i_wth":24.0,"eo_rd":null,"eo_mb":1.5,"eo_at":null,"eo_hb":false,"eo_lc":null,"eo_rtd":"","i_crop":{"crop_oxr":0.0,"crop_oyr":0.0,"crop_rot":0.0,"crop_hr":1.0,"crop_wr":1.0},"i_ht":18.0,"i_rot":0.0,"i_clst":{"cv":{"op":"set","opValue":[]}},"eo_ml":1.5,"i_bri":0.0,"eo_mr":1.5,"i_src":null,"eo_ad":null,"i_cid":"1Rjm2DCijHjqiziUmLhviyc0sZKUzlxudRmxXJp8","i_cont":0.0,"i_opa":1.0,"eo_mt":1.5,"eo_type":0}}},{"ty":"ae","et":"inline","id":"i.10","epm":{"ee_eo":{"eo_bo":{"ln_c":"#000000","ln_s":0,"ln_w":0.0},"eo_lco":{"lc_oi":"","lc_cs":"","lc_ct":0,"lc_sci":""},"i_wth":24.0,"eo_rd":null,"eo_mb":1.5,"eo_at":null,"eo_hb":false,"eo_lc":null,"eo_rtd":"","i_crop":{"crop_oxr":0.0,"crop_oyr":0.0,"crop_rot":0.0,"crop_hr":1.0,"crop_wr":1.0},"i_