_modelChunkLoadStart - DOCS_modelChunkParseStart); DOCS_warmStartDocumentLoader.loadModelChunk(DOCS_modelChunk); DOCS_modelChunk = undefined;</script><script type="text/javascript" nonce="gneJvRs7ninwTyob75QG0yS6fIs"  nonce="gneJvRs7ninwTyob75QG0yS6fIs">DOCS_modelChunkParseStart = new Date().getTime();</script><script type="text/javascript" nonce="gneJvRs7ninwTyob75QG0yS6fIs"  nonce="gneJvRs7ninwTyob75QG0yS6fIs">DOCS_modelChunk = [{"ty":"is","ibi":4335,"s":"\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cMother did not include even a single line to tell me that she misses me . . . In the last letter, she added on a line telling me not to find a\n\n9 mai 2016\n\u001c53\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cboyfriend outside. Although it was only one line, it made me happy, as if Mother were at my side teaching me.\n\n9 mai 2016\n\u001c53\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cDon’t imagine that I can be superhuman. You are just a most ordinary, most plain girl, attracted to anything that is pretty or tasty or fun. So from being ordinary and plain I will make my start.\n\n9 mai 2016\n\u001c55\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cSome people who have always seemed unapproachable may not really be so. You just need to make yourself a little more approachable.\n\n9 mai 2016\n\u001c58\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cSilence: Do not engage in unimportant talk. 3. Order: Place things in fixed positions and do tasks at fixed times.\n\n9 mai 2016\n\u001c58\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cDecisiveness: Decide what you\n\n9 mai 2016\n\u001c58\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cwant to accomplish, be unyielding. 5. Thrift: Do not waste money. Spend money on things that benefit yourself and others\n\n9 mai 2016\n\u001c58\n\u0011\n\u0011\n\n\n5 Factory Girls\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cIn 2001, Adidas initiated a program called Lean Manufacturing to increase efficiency and reduce waste at Yue Yuen. Workers say that while they work shorter hours now, the time on the line is more stressful; tasks are parceled out precisely and there is almost no downtime. Assembly lines have been restructured into small teams so workers can switch tasks every few days, whereas before they might have done the same thing for a month at a time.\n\n9 mai 2016\n\u001c107\n\u0011\n\u0011\n\n\n6 The Stele with No Name\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001c9 mai 2016\n\u001c124\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cFour years now, Father, The grass on the grave is taller now, The plains of the north country are once again covered in snow, Ah, your child wandering on the island in the sea Is sending her heartfelt longing to you. The things that have been lost Can be found again, But what I have lost Is my father’s love, Clothes that are torn can be mended, But, ah, this is A heart that is torn!\n\n9 mai 2016\n\u001c144\n\u0011\n\u0011\n\n\n7 Square and Round\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cMore than two hundred young women signed up for the spring session of the White-Collar Secretarial Skills Special Training Class. Each student paid 780 yuan in tuition up front—more than a month’s salary for many of them. They would attend class three nights a week over the next three months. That was plenty of time to become someone else.\n\nThis is me and my firehose class. Except I need to work harder.\n\n9 mai 2016\n\u001c160\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThe executive said, “I told you that you were not suitable, yet you didn’t leave. Why?” I said, “You don’t know anything about me. You don’t know if I’m suitable or not. I’ve always had a very good impression of Huawei, but I must say I am very dissatisfied with your attitude toward job-seekers today. Whether or not I will be a Huawei employee, as a Huawei customer I am very dissatisfied.” The woman smiled. She was very satisfied with my answer. So I was hired.\n\n9 mai 2016\n\u001c174\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001c9 mai 2016\n\u001c174\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThe saddest person in the world is one without goals or dreams. Because of youth, have confidence. The most important person in the world: yourself\n\n9 mai 2016\n\u001c174\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThe difference between successful people and failures is not in the quality of their ideas or in the measure of their abilities, he had written, but in whether they trust their own judgment and dare to take action. Chen Ying risked jumping to a new job, while Jiang Haiyan did not. In the end, that was the only difference between them that mattered.\n\n9 mai 2016\n\u001c183\n\u0011\n\u0011\n\n\n8 Eight-Minute Date\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001c9 mai 2016\n\u001c189\n\u0011\n\u0011\n\n\n10 The Village\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001c13 juin 2017\n\u001c250\n\u0011\n\u0011"}
}'


